import React from "react";

const NewsBlock = (props) => {
  return (
    <div className="newsBlock">
      <div>
        <span className="header">{props.news.header}</span>
      </div>
      <div>
        <span className="header">{props.news.text}</span>
      </div>
    </div>
  );
};

export default NewsBlock;
